import {BrowserRouter as Router, Route, Link, Switch} from 'react-router-dom'
import Global from './Styles/Global';
import Home from './components/Home';

const routes = [
  {
    path: "/",
    component: Home,
    routes: [
      {
        path: "/home",
        component: Home
      }
    ]
  }
];

const ConfigRouter = () => {
  return (
    <Router>
      <Global>
        <Switch>
          {routes.map((route, i) => (
            <RouteWithSubRoutes key={i} {...route} />
          ))}
        </Switch>
      </Global>
    </Router>
  );
}

export default ConfigRouter;
